import React from "react";


function Login() {

    return (

        <div className="home-right-con">

            <div className="content-home-right bold-light">

                <h1>Welcome back!</h1>

                <form className="form-login" >

                    <label className="label-Inputs" htmlFor="email">Email</label>
                    <input className="no-bold-light login-input" type="text" placeholder="" />

                    <label className="label-Inputs-passord .label-Inputs " htmlFor="email">Password</label>
                    <input className="login-input" type="password" />
                </form>

            </div>






        </div>

    );


}

export default Login;
